import Layout from "../components/Layout";
import Body from "../components/blog/body";

export default function Index() {
  return (
    <Layout>
      <>
        <div className="blog">
          <Body />
        </div>
        <style jsx>{`
          .blog {
            width: calc(100vw - 100px);
            max-width: 1300px;
            margin: 0 auto;
            @media (max-width: 768px) {
              max-width: calc(100vw - 55px);
            }
          }
        `}</style>
      </>
    </Layout>
  );
}
